import React from 'react';

const ContactSection = ()=>{
    return(
        <>
           
                <div className='container sect-C mb-5 py-5 mx-auto justify-content-center align-items-center'>
                    <h3 className='text-center'>Have a Project in Mind</h3>
                    <h2 className='text-center'>Let Me Help You</h2>
                    <a href='/contact' className=''>Contact Now</a>
                </div>
           
        </>
    );
};
export default ContactSection;
